import React from 'react'
import axios from 'axios'
function DonationRequests() {

    const [requests, setRequests] = React.useState([])
    //  username , quantity, serving
    const user = useSelector(state=>state.user.userInfo)
    const myDonationRequests = async () => {
        const config = {
            headers: {
                'Content-Type': 'application/json',
                Authorization: `Bearer ${user.token}`
            }
        }
        const { data } = await axios.get('http://127.0.0.1:8000/api/restaurant/donation-requests/', config)
        console.log(data)
        setRequests(data)
    }

    React.useEffect(() => {
        myDonationRequests()
    }, [])

    return (
        <div>
            {requests?.map(item => (
                <div>
                    <h1>{item.username}</h1>
                    <h1>{item.quantity}</h1>
                    <h1>{item.serving}</h1>
                </div>
            ))}
        </div>
    )
}

export default DonationRequests
